export function Rllista(props) {
  const renderRow = function (item, fields) {
    return props.header.map((field) => (
      <td key={field}>{item[field] || ''}</td>
    ));
  };

  return (
    <table>
      <thead>
        <tr>
          {props.header.map((item) => (
            <th key={item.header}>{item.header}</th>
          ))}
        </tr>
      </thead>
      <tbody>
        {props.data.map((elem, index) => (
          <tr key={index}>{renderRow(elem, props.data)}</tr>
        ))}
      </tbody>
    </table>
  );
}
